import {Chart , ChartJS } from "chart.js/auto";
import {Bar, Doughnut, Line} from "react-chartjs-2";
import "./Chart1.css";

function Chart1(){
    return( 
        <div>
            <Bar 
                data={{
                    labels: ["A","B","C"],
                    datasets:[
                        {
                            label: "Revenue",
                            data: [200,300,400],
                        },
                        {
                            label: "Loss",
                            data: [70,80,90],
                        },
                    ],
                }}/>
        </div>
    )
}

export default Chart1;
